import { FormControl, FormGroup, InputLabel, Input } from "@mui/material";


const AddUser=()=>{
    return (
        <FormGroup>
            <FormControl>
                <InputLabel>Name</InputLabel>
                <Input/>
            </FormControl>
        </FormGroup>
    )

}
export default AddUser;
